import axios from "axios";

export const getCards = async () => {
    try {
        const response = await axios.get('http://localhost:5098/GetHeaders');
        return response.data;
    } catch (error) {
        console.error(error);
        throw error; // Можно выбросить ошибку или вернуть пустое значение в зависимости от требований
    }
};
